import React, { Component } from "react";

class About extends Component {
  state = {};
  render() {
    return (
      <div>
        <h1>About</h1>
        <p>
          This react app controls and monitors ROS-enabled robots through a Web
          Interface
        </p>
      </div>
    );
  }
}

export default About;
